import React, {Component} from 'react';
import {Text, View} from 'react-native';

class Idade extends Component{
    render(){
        return(
            <view>
                <text style={{fontSize:17, fontWeight:'sans'}}>
                    23 anos
                </text>
            </view>
        )
    }
}

export default Idade
